export const getProducts = (func) => {
    return fetch('https://yalantis-react-school-api.yalantis.com/api/v1/product')
        .then((result) => result.json())
        .then((result) => {
            return result.items;
        })
        .catch((error) => {
            return func({error: error})
        })
}
